class Solution {
  int findMaximumLength(List<int> nums) {
    int maxLength = 1;
    int n = nums.length;

    // Iterate over all possible subarrays
    for (int i = 0; i < n; ++i) {
      for (int j = i; j < n; ++j) {
        int minVal = nums[i];
        int maxVal = nums[j];
        bool valid = true;

        // Check if the subarray can form a non-decreasing sequence
        for (int k = i; k <= j; ++k) {
          if (nums[k] < minVal || nums[k] > maxVal) {
            valid = false;
            break;
          }
        }

        // Update maxLength if a longer valid subarray is found
        if (valid) {
          maxLength = max(maxLength, j - i + 1);
        }
      }
    }

    return maxLength;
  }

  int max(int a, int b) => a > b ? a : b;
}
